00190     public static TypeClauseNode ConvertToTypeClauseNode(ISyntax syntax, IParserModel model)
00191     {
00192         if (syntax.SyntaxKind == SyntaxKind.TypeClauseNode)
00193         {
00194             return (TypeClauseNode)syntax;
00195         }
00196         else if (syntax.SyntaxKind == SyntaxKind.IdentifierToken)
00197         {
00198             return new TypeClauseNode(
00199                 (IdentifierToken)syntax,
00200                 null,
00201                 null);
00202         }
00203         else if (IsTypeIdentifierKeywordSyntaxKind(syntax.SyntaxKind))
00204         {
00205             return new TypeClauseNode(
00206                 (KeywordToken)syntax,
00207                 null,
00208                 null);
00209         }
00210         else if (IsContextualKeywordSyntaxKind(syntax.SyntaxKind))
00211         {
00212             return new TypeClauseNode(
00213                 (KeywordContextualToken)syntax,
00214                 null,
00215                 null);
00216         }
00217         else
00218         {
00219             // 'model.TokenWalker.Current.TextSpan' isn't necessarily the syntax passed to this method.
00220             // TODO: But getting a TextSpan from a general type such as 'ISyntax' is a pain.
00221             //
00222             model.DiagnosticBag.ReportTodoException(
00223                 model.TokenWalker.Current.TextSpan,
00224                 $"The {nameof(SyntaxKind)}: {syntax.SyntaxKind}, is not convertible to a {nameof(TypeClauseNode)}. Invoke {nameof(IsConvertibleToTypeClauseNode)} and check the result, before invoking {nameof(ConvertToTypeClauseNode)}.");
00225             
00226             // TODO: Returning null when it can't be converted is a bad idea (the method return isn't documented as nullable).
00227             return null;
00228         }
00229     }
