00237     public static IdentifierToken ConvertToIdentifierToken(ISyntax syntax, IParserModel model)
00238     {
00239         if (syntax.SyntaxKind == SyntaxKind.IdentifierToken)
00240         {
00241             return (IdentifierToken)syntax;
00242         }
00243         else if (IsContextualKeywordSyntaxKind(syntax.SyntaxKind))
00244         {
00245             var keywordContextualToken = (KeywordContextualToken)syntax;
00246             return new IdentifierToken(keywordContextualToken.TextSpan);
00247         }
00248         else
00249         {
00250             // 'model.TokenWalker.Current.TextSpan' isn't necessarily the syntax passed to this method.
00251             // TODO: But getting a TextSpan from a general type such as 'ISyntax' is a pain.
00252             //
00253             model.DiagnosticBag.ReportTodoException(
00254                 model.TokenWalker.Current.TextSpan,
00255                 $"The {nameof(SyntaxKind)}: {syntax.SyntaxKind}, is not convertible to a {nameof(IdentifierToken)}. Invoke {nameof(IsConvertibleToIdentifierToken)} and check the result, before invoking {nameof(ConvertToIdentifierToken)}.");
00256                 
00257             // TODO: Returning default when it can't be converted might be a fine idea? It isn't as bad as returning null.
00258             return default;
00259         }
